import React from 'react';
import DataTable from './Resources/DataTable'

class App extends React.Component
{
  render()
  {
    return(
      <div>
        <div className="row bg-light py-3">
          <div className="col-md-6 d-flex justify-content-start"><h5></h5></div>
          <div className="col-md-6 d-flex justify-content-end">gian</div>
        </div>

      </div>
    )
  }  
}

export default App;

